import "./header.css";

const Header = () => {
    return (
        <div className="header">
            <div className="header__wrapper">
                <div className="header__left">left</div>
                <div className="header__center">center</div>
                <div className="header__right">right</div>
            </div>
        </div>
    );
};

export default Header;
